import react from "react";
const Displaying = ({sensor}) => {
   let sensordata = sensor.sensordata.ttring();
   let sd = sensordata.concat("%;");
    return (
        <tr>
        <th scope="row">{sensor.sensorid}</th>
        <td>{sensor.sensorname}</td>
        <td>{sensor.sensordata}</td>
        <td>
        <div class="progress">
  <div class="progress-bar" role="progressbar" style={{width: {sd}}} aria-valuenow="25" aria-valuemin="0" aria-valuemax="100">{sensor.sensordata}%</div>
</div>
        </td>
      </tr>
      );
}

export default Displaying;
